Head shield smooth. Frontal margin with strong median notch and short median furrow; posterior margin transverse; border very slightly wider posterolaterally than posteromedially. Antennal length 3.1–4.7 times width of head shield, usually extending back to tergite 5 (
Fig. 12A
); 36– 43 articles, commonly 40 or 41; basal two articles much larger than succeeding two (
Fig. 14A
); antenna with a markedly uneven change in the length of articles in proximal part, with short paired articles interspersed between longer articles (
Fig. 14B
); articles mostly substantially longer than wide in distal half of antenna; antenna densely setose along most of length, with many short, curved sensilla interspersed with long trichoid sensilla (
Fig. 14C
). Ocellus moderately large, overhanging lateral margin of head, usually translucent, whitish to dark purple, domed. Tömösváry organ small, fairly shallow, longitudinally elliptical, situated inward of anterolateral margin of cephalic pleurite (
Fig. 15D,E
).

Clypeus with transverse band of six setae medially just in front of labrum (
Fig. 15B
), cluster of 10 setae at clypeal apex (
Fig. 15A
). Labral margin with rounded shoulder beside midpiece, with gradual break in curvature where fringe of branching bristles overhangs margin (
Fig. 15B
); most bristles with short, spine-like projections along their length, some branching into long, slender spines distally (
Fig. 15C
).

