Maxillipede coxosternum trapezoidal to subsemicircular, dental margin broad, each half gently convex (
Fig. 16A,B
); median notch at most narrow, shallow (
Fig. 16D
); teeth small, triangular projections, invariably 3+3, with space between outer tooth and adjacent tooth more than twice space between inner two teeth (
Fig. 16C–E
), inner tooth smaller than the others. Coxosternum bearing moderate number of small to moderate sized setae (
Fig. 16D
), mostly confined to anterior half of coxosternum (
Fig. 16A,B
). Tarsungulum with long, slender pretarsal section (
Fig. 16A,B
). Setae on telopodite denser on inner part of femur, tibia and tarsal section of tarsungulum than on outer part, especially long on tarsungulum (
Fig. 16C
).

Mandible as described for 

H. tropicanus

except for the following: ventral aciculae in outer row of aciculae with both margins serrated along their distal fifth to third (
Fig. 14G,I
); grooved ridge on accessory denticle field of all but ventralmost paired tooth (
Fig. 14D,F
); ventral bristles in fringe of branching bristles lacking spine-like projections on basal fifth of bristles (
Fig. 14H
); fringe of scale-like branching bristles extends to furry pad (
Fig. 14J
); bristles of furry pad curved towards dorsalmost tooth (
Fig. 14F,J
).

First maxilla (
Fig. 15H–J
) as described for 

H. tropicanus

except: coxal process with a few short simple setae, several laciniate and plumose setae with intermediates between these (some with a few terminal spines, others with numerous short, slender projections along their distal halves) (
Fig. 15J
); distal article of telopodite with several simple setae scattered over its main field (
Fig. 15I
). Second maxilla (
Fig. 15K–M
) as described for 

H. tropicanus

.

