Tergites wrinkled, faintly so anteriorly but considerably so in posterior half of trunk. T1 trapeziform, about as wide as head shield (
Fig. 12A
), about 80% width of widest tergite (T8), posterior angles rounded and posterior margin gently concave; lateral borders subparallel in TT3 and 5, posterior angles rounded, posterior margins gently concave; TT1, 3 and 5 bordered posteriorly; border of T7 incomplete posteriorly; posterior margin of T7 evenly concave, posterior angle blunt; posterior margins of TT8 moderately, fairly evenly concave, posterior angles obtuse, blunt; posterior margins of TT6, 11 and 13 all evenly concave, increasingly so more posteriorly; T9 variably with nearly transverse median sector; posterior angle of T6 rounded, TT9, 11 and 13 with triangular projections; posterior margin of T14 moderately concave, with obtuse posterior angles; tergite of intermediate segment with weakly concave posterior margin in female, moderately concave margin in male. Tergal surface and margins scattered with short setae, in some specimens relatively numerous, e.g., posterior margins of TT3 and 4 fringed by about 20 setae. Longitudinal median furrow confined to anterior part of sternites, not more than one-third length of sternite.

