subSubSection.paragraph:
Legs: Distal spinose projections on tibiae strong, pointed on legs 1–14. Setae relatively uniformly distributed along length of legs, with similar setal density on inner and outer faces of all podomeres; legs 14 and 15 (
Fig. 13C,D
) with similar setal density as 1–13 (
Fig. 13A,B
). Three tarsomeres in legs 1–12 (
Fig. 13A
), with divided basitarsus; tarsal articulations discontinuous on dorsal side of leg in anterior part of trunk; three pairs of consistently strong, pigmented, divergent setae on tarsi of legs 1–12, one just proximal to each articulation between tarsomeres, one near midlength of distal tarsomere. Basitarsus-distitarsus joint with a condyle in legs 13–15 only, basitarsus undivided in these three legs; three tarsomeres in leg 13 (
Figs. 13B
, 
15F
); four tarsomeres in leg 14 (
Fig. 13C
), distitarsus about 65% length of basitarsus, three tarsomeres comprise about 45–55, 15– 25 and 25–35% (proximal to distal) length of distitarsus; five tarsomeres in leg 15, the proximal distitarsal podomere about 50–55% length of distitarsus, second and third shorter than fourth (
Fig. 13D
). Distitarsus 70–85% length of basitarsus in leg 15; basitarsus 10–12 times longer than broad. Pretarsus with anterior and posterior accessory claws on all legs, about 30% length of main claw, inserted on dorsolateral side of main claw, with gentle dorsoventral curvature (
Fig. 14K
). Main claw gently curved, divided into many elongate, scales along most of its length, with short, polygonal scales ventrolaterally in region beneath proximal part of accessory claws, a few pores between these scales (
Fig. 14L
), pore openings in the middle of small polygons; scales weakly defined proximally beneath bases of accessory claws and on proximoventral surface of main claw, well defined dorsoproximally. Posteroventral spine ('sensory spur' of 
Eason, 1964
: fig. 486) present on legs 1– 14 (
Fig. 14L
), absent on leg 15 (
Fig. 15G
), about 15% length of main claw, directed distally, bearing slender subsidiary spine that parallels it on its dorsoproximal half (
Fig. 14L
); accessory claws and posteroventral spine with surface ornament of linear grooves and ridges.

Coxal pores round, transversely ovate, or elliptical, typically with round distal pores and elliptical proximal pores (
Fig. 12B
); overwhelmingly 6,5,5,5/6,5,5,5 in large females (width head shield>1.75 mm), 5,4,4,4/5,4,4,4 in large males; maximum in males 5,5,5,5/5,5,5,5. Coxal pore field set in shallow groove. Anal pores large in both sexes.

Female (
Fig. 12B
): Sternite of segment 15 transverse or convex posteromedially, with about a dozen setae along posterolateral and posteromedial margins. Tergites of first genital segment and telson usually well sclerotized; sternite of first genital segment large, posterior margin concave, with median bulge, between condyles of gonopods, surface scattered with setae, longest and densest posterolaterally (
Fig. 16G
). First article of gonopod bearing two moderately large, bullet-shaped spurs, inner spur slightly smaller (
Fig. 16G–J
); spurs gently curved such that tip points up (
Fig.

16I); first article usually bearing more than 30 setae in large specimens (up to 38), second article with 12–20 moderately long setae; third article with three to eight setae. Claw large, undivided, numerous pores with sensilla coeloconica on dorsodistal surface of claw (
Fig. 16J
).

Male (
Fig. 12C
): Sternite of segment 15 with subtransverse (
Fig. 12C
) to moderately convex (
Fig. 16F
) posteromedial margin. Sternite of first genital segment small, divided, with transverse posterior margin, bearing about 20 moderate to long setae on each half with slight to moderate concentration near posterior margin. Gonopod of three articles and tapering, seta-like terminal process (
Fig. 16K,L
), with many short spine-like projections along its inner margin; articles of gonopod each typically bear 10– 12 setae; many setae on gonopod and first genital sternite curved, at least distally.
